import React from "react";
import { useWaterBrands, useWaterSources } from "../../custom-hooks";
import "./table.css";

const Table = () => {
  const columns = [
    "브랜드",
    "제조원",
    "수질적합여부",
    "부적합판정횟수",
    "출시일",
  ];
  const waterBrands = useWaterBrands();
  const waterSources = useWaterSources();


  return (
    <div className="tableWrapper">
      <div className="tableTable">
        <thead>
          <tr>
            {columns.map((column) => (
              <th>{column}</th>
            ))}
          </tr>
        </thead>
        <tbody>
            {waterBrands.map((waterBrand, index) => (<tr key={index}>
                <td>{waterBrand.name}</td>
            </tr>))}
        </tbody>
      </div>
    </div>
  );
};

export default Table;
